import React from 'react'
import "./App.css";
import { BrowserRouter,Routes,Route } from "react-router-dom"
import { LoginPage, SignupPage } from "./Routes.js";

const App = () => {
  return (
    <div>
      <BrowserRouter>
      <Routes>
        <Route path='/login' element={<LoginPage />} />
        <Route path='/sign-up' element={<SignupPage />} />
      </Routes>
      </BrowserRouter>
    </div>
  )
}

export default App
